import "./App.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbars from "./navbars/Navbars";
import TechList from "./screens/TechLIst";

function App() {
  return (
    <div className="App">
      <Router>
        <Navbars />
        <Routes>
          <Route path="/" element={<TechList />} exact />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
